import React, { useEffect } from 'react'
import { NavLink } from 'react-router-dom';
import logo from '../../assets/images/logo.png'
const Sidebar = () => {

    useEffect(() => {
        const myElement = document.querySelector('.nav-link2.active');
        const myElement2 = document.querySelector('.nav-link.active');

        if (myElement) {
            myElement.closest('.collapse').classList.add('show');
            const myparent = myElement.closest('.collapse')
            myparent.previousElementSibling.classList.add('active');

        } else if (!myElement && !myElement2) {
            document.querySelector('#siteconfigure').classList.add('show');
            const myparent = document.querySelector('#siteconfigure')
            myparent.previousElementSibling.classList.add('active');

        }
    })

    const onActiveMenuChange = (e) => {
        const newele = document.querySelector('.accordion-heading.active');
        const newcolp = document.querySelector('.collapse.show');

        if (newele && newcolp) {
            newele.classList.remove('active');
            newcolp.classList.remove('show');
        }
        e.target.classList.add('active')
    }
    return (
        <>
            <div className="page-wrapper doctris-theme toggled">
                <nav id="sidebar" className="sidebar-wrapper">
                    <div className="sidebar-content">
                        <div className="sidebar-brand">
                            <a >
                                <img src={logo} />
                            </a>
                        </div>
                        <ul className="sidebar-menu">

                            <li><NavLink><i className="fi fi-rr-dashboard"></i> Dashboard</NavLink></li>

                            <li className="sidebar-dropdown">
                                <NavLink ><i className="fi fi-rr-users"></i> Users</NavLink>
                                <div className="sidebar-submenu">
                                    <ul>
                                        <li><NavLink >Loren</NavLink></li>
                                        <li><NavLink >Loren</NavLink></li>
                                    </ul>
                                </div>
                            </li>

                            <li className="sidebar-dropdown">
                                <a ><i className="fi fi-rr-pharmacy"></i> Month Long course</a>
                                <div className="sidebar-submenu">
                                    <ul>
                                        <li><NavLink >Loren</NavLink></li>
                                        <li><NavLink >Loren</NavLink></li>
                                    </ul>
                                </div>
                            </li>

                            <li className="sidebar-dropdown" onClick={(e) => onActiveMenuChange(e)}>
                                <a><i className="fi fi-rr-test-tube"></i>  Year Long course</a>
                                <div className="sidebar-submenu">
                                    <ul>
                                        <li><NavLink to='/module'>Modules</NavLink></li>
                                        <li><NavLink to='/topic'>Topics</NavLink></li>
                                    </ul>
                                </div>
                            </li>

                            <li><NavLink ><i className="fi fi-rr-briefcase"></i> Quiz</NavLink></li>

                            <li><a ><i className="fi fi-rr-question-square"></i> Flashcard</a></li>
                            <li><a ><i className="fi fi-rr-question-square"></i> Audio Suggestion</a></li>
                        </ul>
                    </div>
                </nav>
            </div>
        </>
    )
}

export default Sidebar;
